  input: '"TEXT","F3XN","C00084475","In rare instances the 3M PAC has a near zero
    or slightly negative balance per book purposes.  At March 31, 2007, the 3M PAC
    had a negative book balance of approximately $40.  This is due to the timing of
    check printing (prior to period end) versus the timing of check signing and issuance.  At
    this period end, certain checks were printed in March and placed in queue for
    issuance upon signing.  Issuance occurred in eary April, but the print date triggers
    inclusion in our related systems that generate our reports.  Monthly payroll deductions
    of contributions to the PAC are received and deposited at the beginning of each
    month and PAC disbursement checks issued are generall outstanding for several
    weeks.  Thus, the PAC bank balance includes sufficient funds, while the PAC book
    balance displays a slight negative at period cut-off."'
